const Title = () => {
  const [queque, setQueque] = useState([]);
  useEffect(()=> {
    setQueque(Array(50).fill('GREENPOST * '));
  })
  return(
    <div>
      <ul>
        {
          queque.map(word => <li>{word}</li>)
        }
      </ul>
      <style jsx >{`

      `}
      </style>
    </div>
  )
}

const Main = () => {
  return(
    <div className="main">
      <Title />
    </div>
  )
}

export default Main;
